				["script"] = "local mh = unit:MissingHealth();\n\ntext = VFL.strtcolor(classColor);\nif (UnitIsDeadOrGhost(uid)) then \n  text =\"\";\nelseif (UnitIsConnected(uid) == nil) then\n  text = VFL.strcolor(0.6,0.6,0.6) .. \"LD\";\nelseif(FD_flag) then\n  text = VFL.strcolor(0.6,0.6,0.6) .. \"FD\";\nelseif math.floor((UnitHealth(uid)/UnitHealthMax(uid))*100) <= 85 then \n  text = text .. string.sub(VFL.Kay(mh),1,4);\nelse\n  text = text .. string.sub(UnitName(uid), 1, 5);\nend",
